import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';

console.log('App.tsx loaded!');

function App() {
  console.log('App component rendering!');

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={
          <div style={{ padding: '20px' }}>
            <h1>PlexiSystem Kalkulator działa!</h1>
            <p>Aplikacja została uruchomiona pomyślnie!</p>
            <hr />
            <h2>Sprawdź konsolę przeglądarki</h2>
            <p>Powinieneś zobaczyć następujące komunikaty:</p>
            <ul>
              <li>Index.tsx loaded!</li>
              <li>Root created!</li>
              <li>App.tsx loaded!</li>
              <li>App component rendering!</li>
              <li>App rendered!</li>
            </ul>
            <div style={{ marginTop: '20px', padding: '10px', backgroundColor: '#e3f2fd', borderRadius: '5px' }}>
              <p><strong>Status:</strong> ✅ React działa poprawnie</p>
              <p><strong>URL:</strong> {window.location.href}</p>
              <p><strong>Ścieżka:</strong> {window.location.pathname}</p>
            </div>
          </div>
        } />
        <Route path="/monsterluk/plexi_appk" element={<Navigate to="/" />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
